#include <bits/stdc++.h>
using namespace std;

// Complete the steadyGene function below.
int steadyGene(string gene) {

gene="";
long long int n = gene.length();
cout<<"n yahan pe hai"<<n;
vector<vector<int>> data(n,vector<int>(4,0));
if(gene[0]=='A')
    {
        data[0][0]++;
    }
    else if(gene[0]=='C')
    {
        data[0][1]++;
    }
    else if(gene[0]=='G')
    {
        data[0][2]++;
    }
    else
    {
        data[0][3]++;
    }
for(int i=1;i<n;i++)
{
    if(gene[i]=='A')
    {
        data[i][0]=data[i-1][0]+1;
        data[i][1]=data[i-1][1];
        data[i][2]=data[i-1][2];
        data[i][3]=data[i-1][3];
    }
    else if(gene[i]=='C')
    {
        data[i][0]=data[i-1][0];
        data[i][1]=data[i-1][1]+1;
        data[i][2]=data[i-1][2];
        data[i][3]=data[i-1][3];
    }
    else if(gene[i]=='G')
    {
        data[i][0]=data[i-1][0];
        data[i][1]=data[i-1][1];
        data[i][2]=data[i-1][2]+1;
        data[i][3]=data[i-1][3];
    }
    else
    {
        data[i][0]=data[i-1][0];
        data[i][1]=data[i-1][1];
        data[i][2]=data[i-1][2];
        data[i][3]=data[i-1][3]+1;
    }
}
int length = INT_MAX;
int nA=data[n-1][0],nC=data[n-1][1],nG=data[n-1][2],nT=data[n-1][3];
int nAExtra=0,nCExtra=0,nGExtra=0,nTExtra=0;
if(nA>n/4)nAExtra=nA-n/4;
if(nC>n/4)nCExtra=nC-n/4;
if(nG>n/4)nGExtra=nG-n/4;
if(nT>n/4)nTExtra=nT-n/4;
cout<< "n is "<<n <<endl;
cout<<nA<<" "<<nC<<" "<<nG<<" "<<nT<<endl;
cout<<nAExtra<<" "<<nCExtra<<" "<<nGExtra<<" "<<nTExtra<<" ";
int extra=nAExtra+nCExtra+nGExtra+nTExtra;
int left=0,right=extra-1;

while(1)
{
    if(left==0)
    {
        if(nAExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][0]-nAExtra;
                if(x!=0)
                {
                    if(x<0)
                    {right++;
                    if(right!=n)
                    continue;}
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nCExtra!=0)
        {
            if(right!=n)
            {
                int x = data[right][1]-nCExtra;
                if(x!=0)
                {
                    if(x<0)
                    { right++;
                      if(right!=n)
                      continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nGExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][2]-nGExtra;
                if(x!=0)
                {
                    if(x<0)
                    {   right++;
                        if(right!=n)
                        continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nTExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][3]-nTExtra;
                if(x!=0)
                {
                    if(x<0)
                    {   right++;
                        if(right!=n)
                        continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if((right+1)<length)length=right+1;
         if(length==extra)
        {
           cout<<"kahin yahan se to bakchodi ni hui";
            return length;
        }

        left++;
    }
    else
    {
        if(nAExtra!=0)
        {
            if(right!=n)
            {
                int x = data[right][0]-data[left-1][0]-nAExtra;
                if(x!=0)
                {
                    if(x<0)
                    {right++;
                     if(right!=n)
                     continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nCExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][1]-data[left-1][1]-nCExtra;
                if(x!=0)
                {
                    if(x<0)
                    {right++;
                     if(right!=n)
                     continue;}
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nGExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][2]-data[left-1][2]-nGExtra;
                if(x!=0)
                {
                    if(x<0)
                    {
                     right++;
                     if(right!=n)
                     continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if(nTExtra!=0)
        {
            if(right!=n)
            {   int x = data[right][3]-data[left-1][3]-nTExtra;
                if(x!=0)
                {
                    if(x<0)
                    {
                     right++;
                     if(right!=n)
                     continue;
                    }
                    if(x>0)
                    {
                        left++;
                        if(left!=right)
                        continue;
                    }
                }
            }
        }
        if((right-left+1)<length && (right-left+1)>=extra)
        {
            length=right-left+1;
        }
        left++;
    }
    if(right>n-1)break;
    else if(right==n-1 && (right-left)<extra-1)break;
}
//if(length==INT_MAX)return 2;
//else
if(length==INT_MAX)cout<<"yahan hui hai";
return length;
}

int main()
{
    ofstream fout(getenv("OUTPUT_PATH"));

    int n;
    cin >> n;
    cout<<"n at int main is"<<n<<endl;
    cin.ignore(numeric_limits<streamsize>::max(), '\n');

    string gene;
    getline(cin, gene);

    int result = steadyGene(gene);

    cout<<"result is "<<result<<endl;
    fout << result << "\n";

    fout.close();

    return 0;
}
